import './App.css';
import React, { useState } from 'react';
import { library } from '@fortawesome/fontawesome-svg-core'
import { fas } from '@fortawesome/free-solid-svg-icons'
import { faTwitter, faFontAwesome } from '@fortawesome/free-brands-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import LogIn from './LogIn/LogIn.js';
import Register from './Register/Register.js';
import Place from './Place/Place.js'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import UserHomePage from './userHomePage/UserHomePage.js'

library.add(fas, faTwitter, faFontAwesome)

class User extends React.Component {
  constructor(props) {
    super(props);
    this.state = { click: false }
    this.click = this.click.bind(this);
  }
  click() {
    if (!this.state.click) {
      this.setState({
        click: true
      })
    } else {
      this.setState({
        click: false
      })
    }
  }
  render() {
    if (!this.state.click) {
      return (
        <div className='user'>
          <button onClick={this.click} type="button" className="btn btn-outline-primary rounded-5">
            <FontAwesomeIcon icon="fa-solid fa-user" />
          </button>
        </div>
      );
    } else {
      return (
        <LogIn setUser={this.props.setUser} close={this.click} click={this.state.click} />
      );
    }

  }
}

class Search extends React.Component {
  constructor(props) {
    super(props);
    this.state = { click: false }
    this.click = this.click.bind(this);
  }
  click() {
    this.setState({
      click: true
    })
  }
  render() {
    if (!this.state.click) {
      return (
        <div className='search'>
          <button onClick={this.click} type="button" className="btn btn-outline-primary rounded-5">
            <FontAwesomeIcon icon="fa-solid fa-magnifying-glass" />
          </button>
        </div>
      );
    }
    return (
      <div className='search'>
        <input className="form-control rounded-5 border-primary text-center" type="text" placeholder="Place" aria-label="default input example"></input>
      </div>
    );
  }
}

function VisitantHomePage( {setUser} ) {
  return(
    <div id="homepage" className='conteiner-fluid'>
      <div />
      <Search />
      <User setUser={setUser} />
    </div>
  )
}

function HomePage() {
  const [user, setUser] = useState(null)
  return (
    <div>
      {user? <UserHomePage user={user} /> : <VisitantHomePage setUser={setUser} />}
    </div>

  );
}

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path='/register' element={<Register />} />
          <Route path='/' element={<HomePage />} />
          <Route path='/place' element={<Place />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
